import React from "react";
import Topbar from "../components/Topbar";
import Navbar from "../components/Navbar";

export default function Home() {
  return (
    <div>
      <header className="main-header">
        <nav class="navbar navbar-static-top">
          <Topbar/>
            <Navbar/>          
        </nav>
      </header>
    </div>
  );
}
